import Document, {Html,Main,Head,NextScript} from 'next/document';
class MyDocument extends Document {
    render(){
        return (
            <Html>
                <Head />
                <body>
                    <Main/>
                    <NextScript/>
                </body>
            </Html>
        )
    }
}

export default MyDocument;
